import styled from "styled-components";
import { motion } from "framer-motion";

const TagSideListStyle = styled(motion.div)`
  background-color: #e5e5e5;
  margin-bottom: 50px;
  display: flex;
  flex-wrap: wrap;
  padding: 20px;
  width: 100%;
  background-color: darkcyan;

  span {
    padding: 10px;
    background-color: #f8f8ff;
    color: #1b1811;
    margin: 10px;
    font-size: 14px;
    cursor: pointer;
  }
  .title {
    cursor: auto;
    position: relative;
    width: 100%;
    font-size: 20px;
    color: #1b1811;
    margin-bottom: 10px;
    padding-bottom: 10px;
    padding-left: 0;
    background-color: inherit;
  }
`;

const tags = `
Garden (13)_Jewelry (16)_Industrial (15)_Tools (21)_Automotive (16)_Toys (25)_Outdoors (14)_Health (4)_Electronics (7)_Industrial (26)_Health (20)_Toys (22)_Sports (15)_Automotive (9)_Computers (26)_Design (15)_Beauty (27)_Books (25)_`;

const TagSideList = () => {
  return (
    <TagSideListStyle>
      <span className="title"> Discover more tags </span>
      {tags.split("_").map((e, i) => {
        if (e != "")
          return (
            <motion.span
              className="tag"
              transition={{ duration: 0.2 }}
              whileHover={{ backgroundColor: "#1f1f1f", color: "#f8f8ff" }}
            >
              {e}
            </motion.span>
          );
      })}
    </TagSideListStyle>
  );
};

export default TagSideList;
